import React from 'react'
import styled from "styled-components";
function Chat() {
    return (
        <chatContainer>
            <h1>chat</h1>
            <h1>chat</h1>
            <h1>chat</h1><h1>chat</h1>
        </chatContainer>
    )
}

export default Chat

const chatContainer=styled.div`
    margin-top:100px;
    flex-direction:0.7;
    flex-grow:1;
    background-color:green;
    font-size:500px;
    overflow-y:scroll;
   
    
    `;
